    false,nt"url": null,nt"notes": " Then               Topological Faces /
    Area Hydrography Relationship File (FACESAH.dbf) contains an               record
    for each face / area hydrography feature relationship. Face refers to then               areal
    (polygon) topological primitives that make up MTDB. A face is bounded by one orn
                  more edges; its boundary includes only the edges that separate it
    from other faces,n               not any interior edges contained within the area
    of the face. The face to which an               record in the Topological Faces
    / Area Hydrography Relationship File (FACESAH.dbf)n               applies can be
    determined by linking to the Topological Faces Shapefile (FACES.shp)n               using
    the permanent topological face identifier (TFID) attribute. The arean               hydrography
    feature to which a record in the Topological Faces / Area Hydrographyn               Relationship
    File (FACESAH.dbf) applies can be determined by linking to the Arean               Hydrography
    Shapefile (AREAWATER.shp) using the area hydrography identifier (HYDROID)n               attribute.
    A face may be part of multiple area water features. An area water featuren               may
    consist of multiple faces. ",nt"license_title": null,nt"extras": [{ntt"key":
